Method.Source:
/// <summary>
/// Inserts the entity data source.
/// </summary>
/// <param name = "entityCtx">Entity runtime context.</param>
/// <param name = "dataSourceCtx">Data source runtime context.</param>
/// <returns>true if saved successfully; otherwise, false.</returns>
public boolean insertEntityDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    boolean ret;

    RetailParameters retailParameters = RetailParameters::find();
    if (retailParameters)
    {
        throw error(strFmt("@Retail:EntityDuplicateRecord", tableId2PName(tableNum(RetailParameters))));
    }

    ret = super(_entityCtx, _dataSourceCtx);

    return ret;
}

/// <summary>
/// Find entity data source.
/// </summary>
/// <param name = "_entityCtx">Entity runtime context.</param>
/// <param name = "_dataSourceCtx">Entity data source runtime context.</param>
/// <returns>The entity data soure.</returns>
public Common findEntityDataSource(DataEntityRuntimeContext _entityCtx, DataEntityDataSourceRuntimeContext _dataSourceCtx)
{
    Common ret;

    if (_dataSourceCtx.name() == tablestr(RetailParameters))
    {
        ret = RetailParameters::find();
    }
    else
    {
        ret = super(_entityCtx, _dataSourceCtx);
    }

    return ret;
}
